// Navbar.js
import React, { useState } from "react";
import { Container, List, Logo, Hamburger } from "./NavbarStyles";
import { FaRegUser, FaHeartbeat } from "react-icons/fa";
import { ImManWoman } from "react-icons/im";
import { GiMusicalNotes } from "react-icons/gi";
import c1 from "../../components/Img/ieq2.jpg";

export default function Navbar() {
  const [open, setOpen] = useState(false);

  return (
    <Container>
      {/* Logo */}
      <Logo>
        <a
          href="https://maps.app.goo.gl/e9p6hr2WNqNPU19V9"
          target="_blank"
          rel="noopener noreferrer"
        >
          <img src={c1} alt="logo" />
        </a>
      </Logo>

      {/* Hamburger para celulares */}
      <Hamburger onClick={() => setOpen(!open)}>
        <span></span>
        <span></span>
        <span></span>
      </Hamburger>

      {/* Links */}
      <List open={open}>
        <li>
          <FaHeartbeat />
        </li>
        <li>
          <ImManWoman />
        </li>
        <li>
          <GiMusicalNotes />
        </li>
        <li>
          <FaRegUser />
        </li>
      </List>
    </Container>
  );
}
